/// Perform a `GET` request to `/2010-04-01/Accounts.json`.
/// 
/// Retrieves a collection of Accounts belonging to the account used to make the request
/// 
/// **Parameters:**
/// 
/// - `friendly_name: Option<String>`: Only return the Account resources with friendly names that exactly match this name.
/// - `page: Option<i64>`: The page index. This value is simply for client state.
/// - `page_size: Option<i64>`: How many resources to return in each list page. The default is 50, and the maximum is 1000.
/// - `page_token: Option<String>`: The page token. This is provided by the API.
/// - `status: Option<crate::types::AccountEnumStatus>`: Only return Account resources with the given status. Can be `closed`, `suspended` or `active`.
async fn example_default_list_account() -> anyhow::Result<()> {
    let client = twilio_api::Client::new_from_env();
    let result: twilio_api::types::ListAccountResponse = client
        .default()
        .list_account(
            Some("some-string".to_string()),
            Some(4 as i64),
            Some(4 as i64),
            Some("some-string".to_string()),
            Some(twilio_api::types::AccountEnumStatus::Active),
        )
        .await?;
    println!("{:?}", result);
    Ok(())
}

